#include <bits/stdc++.h>

using namespace std;

const int dx[8]{1, 0, -1, 1, -1, 1, 0, -1};
const int dy[8]{1, 1, 1, 0, 0, -1, -1, -1};

int dp[2][64][64][64];

bool chk1(int x, int y) {
	return max(abs(x / 8 - y / 8), abs(x % 8 - y % 8)) < 2;
}

bool chk2(int y, int z) {
	return z + 9 == y || (z % 8 && z + 7 == y);
}

int move_king(int z, int dir) {
	if ((z % 8 == 7 && dir < 3) || (z % 8 == 0 && dir > 4)) {
		return -1;
	}
	z += 8 * dx[dir] + dy[dir];
	return 0 <= z && z < 64 ? z : -1;
}

